import React, { useState } from 'react'

export default function Login() {
	const [email, setemail] = useState('');
	return (
		<div>
			<form action="">
				<label htmlFor="user_email"></label>
				<input
					type="text"
					id='user_email'
					required
					onChange={(event) => setemail(event.target.value)}
				/>
				<label htmlFor="password"></label>
				<input type="text" />

			</form>
		</div>
	)
}
